import React, { useEffect, useState } from "react";
import api from "../../axiosConfig";
import "./AdminDashboard.css";
import { useNavigate } from "react-router-dom";
import DashboardHeader from "./DashboardHeader";

const PendingFeedbacks = () => {
  const navigate = useNavigate();
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [msg, setMsg] = useState("");

  useEffect(() => {
    fetchPendingFeedbacks();
  }, []);

  const fetchPendingFeedbacks = async () => {
    try {
      const res = await api.get("Feedback/all-feedbacks");
      const pending = res.data.filter(f => f.status === "Pending");
      setFeedbacks(pending);
      setLoading(false);
    } catch (err) {
      console.error(err);
      setError("Failed to load pending feedbacks");
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };

  const handleApproveAll = async () => {
    try {
      const res = await api.patch("Feedback/approve-all");
      setMsg(res.data);
      fetchPendingFeedbacks();
    } catch (err) {
      console.error(err);
      setMsg("Failed to approve feedbacks");
    }
  };

  if (loading) return <p style={{ textAlign: "center" }}>Loading pending feedbacks...</p>;
  if (error) return <p style={{ textAlign: "center", color: "red" }}>{error}</p>;

  const users = localStorage.getItem("userName");

  return (
    <div className="dashboard-container">
      <DashboardHeader username={users} onLogout={handleLogout} />
      <h2>Pending Feedbacks</h2>
      {msg && <p className="info-msg">{msg}</p>}
      {feedbacks.length === 0 ? (
        <p>No pending feedbacks</p>
      ) : (
        <>
          <button className="approve-btn" onClick={handleApproveAll}>Approve All</button>
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>User</th>
                <th>Mentor</th>
                <th>Week</th>
                <th>Lines Of Code</th>
                <th>Rating</th>
                <th>Submitted On</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {feedbacks.map(f => (
                <tr key={f.id}>
                  <td>{f.id}</td>
                  <td>{f.userName || "N/A"}</td>
                  <td>{f.mentorName}</td>
                  <td>{f.week}</td>
                  <td>{f.linesOfCode}</td>
                  <td>{f.rating}</td>
                  <td>{f.submittedOn ? new Date(f.submittedOn).toLocaleDateString() : "N/A"}</td>
                  {/* <td>{f.status}</td> */}
                     <td className="status"
                        style={{
                        color:
                          f.status === "Pending"
                            ? "red"
                            : f.status === "Approved"
                            ? "green"
                            : "black",
                       fontWeight: "600"
                      }}
                    >
                      {f.status === "Pending"
                          ? `⏳ ${f.status}`
                          : f.status === "Approved"
                          ? `✅ ${f.status}`
                          : f.status}
                    </td></tr>))}
            </tbody></table></>
      )}
    </div>
  );
};

export default PendingFeedbacks;
